import React from 'react';

function CocktailRecipe({ cocktail }) {
  return (
    <div>
      {cocktail ? (
        <div>
          <h2>{cocktail.strDrink}</h2>
          <img src={cocktail.strDrinkThumb} alt={cocktail.strDrink} />
          <p>{cocktail.strInstructions}</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default CocktailRecipe;
